  const [info, setInfo] = useState({
    longitude: '',
    latitude: '',
    radius: '',
    speed: ''
  })

  const handleChange = (e) => {
    const { name, value } = e.target;
    setInfo(prevState => ({
        ...prevState,
        [name]: value
    }));
  };

  return (
    <div className='App'>

      <Logo />

      <div className='InputSection'>
        <InputBox InputName={"Latitude"} DisplayName={"קו אורך"} />
        <InputBox InputName={"Longitude"} DisplayName={"קו רוחב"} />
        <InputBox InputName={"Radius"} DisplayName={"רדיוס טיסה"} />
        <InputBox InputName={"Speed"} DisplayName={"מהירות"} />
      </div>

    </div>
  );

}
export default App;
